import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

console.log(notes);



function App() {
  return (
    <div>
      <Header />
      {notes.map((noteEntry) => {  <Note 
  key = {noteEntry.id}
  title = {noteEntry.title}
  content = {noteEntry.content}
  />
})} 
      <Footer />
    </div>
  );
}

export default App;
